import React from "react";
import { FaFacebook } from "react-icons/fa";
import { AiOutlineGlobal } from "react-icons/ai";
function Footer() {
  return (
    <>
      <div className="footer">
        <div className="ftr_sub_box"><span className="icon"></span> <span>Toll free 1800 200 1234</span> </div>
        <div className="ftr_sub_box">
          <FaFacebook></FaFacebook> www.facebook.com/cripumps{" "}
        </div>
        <div className="ftr_sub_box">
        <span><AiOutlineGlobal></AiOutlineGlobal> </span>www.cirgroups.com </div>
      </div>
    </>
  );
}
export default Footer;
